軽量で付けやすい、D.A.Dショートストラップの登場です！<BR>
<BR>
世界最高峰の輝きを放つ、スワロフスキー・エレメントを豪華に37石も使用した、
スライド式クラウンエンブレムを採用し、ストラップヘッドの表と裏には
大きなスワロフスキー・エレメントが輝く、高級感溢れるストラップです。<BR>
<BR>
また、革部分には【D.A.D DESIGN COLLECTION】の文字が型押しされております。<BR>
<BR>
■カラー：ホワイト<BR>
■素材：亜鉛合金/牛革/ポリエステル紐/ガラス<BR>
■重量：11.0ｇ <BR>
■長さ：13.0cm <BR>
■仕上げ：バフ/クロムメッキ <BR>
■石：スワロフスキー・エレメント クリスタル/PP5 37石/SS34 2石<BR><br>







